import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product "Add to Cart" button to appear
    await page.waitForSelector('button.add-to-cart', { timeout: 5000 });

    // Rapid Cart Manipulation Stress Test
    // We'll add/remove items rapidly to/from the cart

    // Find all visible "Add to Cart" buttons (limit to 3 for stress test)
    const addToCartButtons = await page.$$('button.add-to-cart');
    const addCount = Math.min(3, addToCartButtons.length);

    // Add each product to the cart 5 times rapidly
    for (let i = 0; i < addCount; i++) {
      for (let j = 0; j < 5; j++) {
        await addToCartButtons[i].click();
        // Wait for notification to appear and disappear (if any)
        await page.waitForTimeout(100);
      }
    }

    // Take screenshot after rapid adds
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_rapid_adds.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_rapid_adds.png'));

    // Open the cart (by clicking on the cart div or icon)
    // Try multiple selectors for robustness
    let cartSelector = '.cart';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.click(cartSelector);

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });
    await page.waitForSelector('#cartItems', { timeout: 5000 });

    // Take screenshot of cart after rapid adds
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_after_adds.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_after_adds.png'));

    // Extract cart items and quantities
    const cartItems = await page.$$eval('.cart-item', items => items.map(item => {
      const title = item.querySelector('.cart-item-title')?.textContent?.trim() || '';
      const price = item.querySelector('.cart-item-price')?.textContent?.replace(/[^0-9.]/g, '') || '';
      const quantity = item.querySelector('.quantity')?.textContent?.trim() || '';
      return { title, price, quantity };
    }));

    // Rapidly increment and decrement quantity of first cart item
    if (cartItems.length > 0) {
      // Find the + and - buttons for the first cart item
      const firstCartItem = (await page.$$('.cart-item'))[0];
      const plusBtn = await firstCartItem.$('button.quantity-btn:nth-of-type(2)');
      const minusBtn = await firstCartItem.$('button.quantity-btn:nth-of-type(1)');

      // Rapidly increment 3 times
      for (let i = 0; i < 3; i++) {
        await plusBtn.click();
        await page.waitForTimeout(80);
      }
      // Rapidly decrement 2 times
      for (let i = 0; i < 2; i++) {
        await minusBtn.click();
        await page.waitForTimeout(80);
      }
    }

    // Take screenshot after rapid quantity changes
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_after_quantity_change.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_after_quantity_change.png'));

    // Rapidly remove all items from cart
    const removeButtons = await page.$$('button.remove-item');
    for (let btn of removeButtons) {
      await btn.click();
      await page.waitForTimeout(100);
    }

    // Take screenshot after removals
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_after_removal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_after_removal.png'));

    // Extract cart state after removals
    const cartEmptyText = await page.$eval('#cartItems', el => el.textContent);

    return {
      success: true,
      action: "Performed rapid cart add, quantity change, and removal stress test. Verified cart state after each phase.",
      extractedData: {
        cartItemsInitial: cartItems,
        cartEmpty: /empty/i.test(cartEmptyText)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
